import Navbar from "./component/Navbar";
import "./App.css";
import Products from "./component/Products";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Navbar />
      <Routes>
        {/* <Route exact path="/" component={}/> */}
        <Route exact path="/products" el={Products} />
      </Routes>
    </>
  );
}

export default App;
